import React from 'react'
import { Card, CardMedia } from "@material-ui/core";
const PersonCard = () => {
  return (
    <>
      <Card sx={{ maxWidth: 345 }}>
        <CardMedia
          component="img"
          alt="green iguana"
          height="140"
          image="https://reqres.in/img/faces/7-image.jpg"
        />
        
      </Card>
    </>
  );
}

export default PersonCard
